"   <div class=\"cntnt\" style=\"width: 305px; height: 597px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Panel A) Group A - AP view of a small infant who had a swollen left elbow after a difficult delivery. The displacement medially of the proximal radius and ulna (arrows) helps to make the diagnosis of a displaced total distal humeral physis. Panel B) Normal elbow for comparison. Panel C) Group B - AP view showing the posteromedial displacement of the distal fragment (arrows). The relationship between the ossification center of the lateral condyle and the proximal radius has been maintained. Panel D) Group C - AP view with marked medial displacement of the distal fragment. Panel E) Group C - lateral view of the same patient showing posterior displacement of the distal fragment. There is also a large metaphyseal fragment associated with the distal fragment (arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Beaty JH, Kasser JR. The elbow: Physeal fractures, apophyseal injuries of the distal humerus, avascular necrosis of the trochlea, and T-condylar fractures. In: Rockwood and Wilkins' Fractures in Children, 6th ed, Beaty JH, Kasser JR (Eds), Lippincott Williams &amp; Wilkins 2006. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.lww.com\">",
"      file://www.lww.com",
"     </a>",
"    </div>",
