var title_f23_33_24092="Common cold treatments in pregnancy 2";
var content_f23_33_24092=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F75622&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F75622&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Agents used to treat the common cold and its symptoms, their efficacy and their safety in pregnancy, continued",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"20%\">",
"     </colgroup>",
"     <colgroup width=\"60%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Agent",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect in randomly controlled trial",
"        <br/>",
"        (not pregnant)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Pregnancy data",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"5\">",
"        Zinc gluconate",
"       </td>",
"       <td rowspan=\"5\">",
"        The evidence of zinc efficacy for treating the common cold is inconclusive at best, and any beneficial effect is minor.",
"       </td>",
"       <td>",
"        The use of zinc for the treatment of the common cold is probably not justified in pregnancy. The noxious taste of zinc lozenges limit their usefulness particularly in pregnant patients.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Animal experiments have produced variable but frequently concerning results regarding the safety of high dose zinc supplementation in pregnancy (including increased skeletal defects in mice, exencephaly in hamsters, and an increased incidence of congenital malformations in rats).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevated zinc levels in the fetus have been associated with anencephaly and meningomyelocele in some studies but not in others. It is unclear whether this finding simply reflects physiologic abnormalities associated with these defects.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        One recent report found one infant with a heart defect and one with microcephaly among 26 infants born to 19 mothers treated with zinc for Wilson's disease. This population is too small to estimate whether zinc exposure played any role in the observed defects.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Zinc deficiency is associated with impaired fertility and low birth weight but is rare in the western world.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vitamin C",
"       </td>",
"       <td>",
"        Current extensive literature does not appear to support the use of vitamin C therapy for the common cold.",
"       </td>",
"       <td>",
"        Little pregnancy data available however, there is concern that large doses of this vitamin may be harmful during pregnancy. Ascorbic acid appears in the fetus in concentrations higher than those in the mother and pregnant guinea pigs fed large doses of ascorbic acid gave birth to offspring with increased rates of ascorbic acid catabolism. A human parallel to this was seen in two reported cases of mothers who ingested daily high doses of vitamin C and after birth the infants developed scurvy due to an excessively rapid metabolism of vitamin C presumably induced in utero.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Echinacea",
"       </td>",
"       <td>",
"        No evidence to support efficacy.",
"       </td>",
"       <td>",
"        Recent data reporting on 206 exposed pregnancies found no increased incidence of anomalies compared with controls.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
