" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Lead line in gingival tooth border",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This man with severe lead poisoning has a \"lead line\", a bluish-gray thin line running along the gingival tooth border, which also has considerable plaque. It is best seen at the location of the arrow. In patients with poor oral hygiene, hydrogen sulfide released by bacteria in the gingival pockets may react with lead in the gingival circulation to produce lead sulfide, a precipitate that appears as a darkly pigmented blue-gray line.",
"    <div class=\"footnotes\">",
